export default {
  name: 'HamburgerMenu',
  props: {
    openMenu: {
      type: Boolean,
      default: false
    }
  },
  data() {
    return {
      open: false
    };
  },
  watch: {
    openMenu(val) {
      this.open = val;
    }
  },
  methods: {
    toggleMenu() {
      this.open = !this.open;
      this.$emit('menu', this.open);
    }
  }
};
